import react from 'react'
import {Switch, Route} from 'react-router-dom'
import LoginPage from './pages/LoginPage'

function App() {
  return (
    <div>
      <Switch>
        <Route path="">
          <LoginPage/>
        </Route>
      </Switch>
    </div>
  );
}

export default App;
